        //     <h1 className={"relative w-full h-auto text-4xl -top-2/3 font-medium font-sans md:text-6xl text-center text-white"}>FIFTHROW SHOWCASE</h1>
        // </div>
        <div className={"w-full h-screen-70 flex relative"}>
            {
                sliderArr.map((item,index)=>{
                    return (
                        <div className={'min-w-full'} key={index}>
                            {item}
                        </div>
                    )
                })
            }
            <button className={'absolute left-0 w-20 h-20'} ></button>
            <button className={'absolute right-0 w-20 h-20'} ></button>

        </div>
    );
}

export default Background;
